import React from "react";
import Card from "@mui/material/Card";
import Button from "@mui/material/Button";
import ArrowBackOutlinedIcon from "@mui/icons-material/ArrowBackOutlined";
import OpenInNewIcon from "@mui/icons-material/OpenInNew";
import Select from '@mui/material/Select';
function Content() {
  return (



    <div style={{ display: "flex", flexDirection: "row", }}>
      <div style={{ width: "100%" }}>
        <div
          style={{
            display: "flex",
            flexDirection: "row",
            justifyContent: "space-between"
          }}
        >
          <div
            style={{
              borderBottom: 2,
              borderColor: "#3772FF",
              borderStyle: "",
              color: "#fff",
              fontSize: 22,
              fontWeight: "bold",

              fontFamily: "Poppins"
            }}
          >
            Section
          </div>
          <div
            style={{
              display: "flex",
              flexDirection: "row",
              color: "white",
              alignContent: "center"
            }}
          >
            0.2 $XYZ{" "}
            <Card
              style={{
                backgroundColor: "#A3E3FF",
                color: "#3772FF",
                alignContent: "center"
              }}
            >
              Tier 1
            </Card>
          </div>
        </div>
        {/* =====================================card1========================================================== */}

        <div
          style={{
            marginTop: 20
          }}
        >
          <Card
            style={{
              backgroundColor: "#A3E3FF",
              alignContent: "center",
              fontFamily: "Poppins",
              fontSize: 14,
              padding: 15,
              fontWeight: "bold"
            }}
          >
            <div>
              Lorem Ipsum is simply dummy text of the printing and typesetting
              industry.
            </div>
            <div
              style={{
                backgroundColor: "white",
                color: "black",
                fontFamily: "Poppins",
                padding: 2,
                width: 80,
                textAlign: "center",
                borderRadius: 5,
                marginTop: 10
              }}
            >
              Tutorial
            </div>
          </Card>
        </div>
        {/* ===========================================card2==================================================== */}
        <div
          style={{
            marginTop: 20
          }}
        >
          <Card
            style={{
              backgroundColor: "#191B20",
              alignContent: "center",
              fontFamily: "Poppins",
              fontSize: 14,
              padding: 15,
              fontWeight: "bold",
              display: "flex",
              flexDirection: "row",
              paddingInline: 10,
              justifyContent: "space-between"
            }}
          >
            <div>
              <div style={{ color: "white", marginBottom: 10 }}>Your rewards</div>
              <div style={{ color: "white", fontSize: 25, marginBottom: 10 }}>
                $ 0.26231428
              </div>
              <div style={{ flexDirection: "row", display: "flex" }}>
                <div style={styles.button}>Tutorial</div>
                <div style={styles.button}>$10 BNB</div>
                <div style={styles.button}>$210 BTC</div>
              </div>
            </div>

            <div style={{ alignSelf: "center" }}>
              <div
                style={{
                  color: "white",
                  alignContent: "center",
                  display: "flex",
                  flexDirection: "row",
                  backgroundColor: "#3772FF",
                  padding: 8,
                  borderRadius: 6,
                  marginRight: 30
                }}
              >
                <OpenInNewIcon style={{ fontSize: 20 }} />
                <div style={{ marginInline: 5 }}>Custom link</div>
              </div>
            </div>
          </Card>
        </div>
      </div>

      <div style={{ width: 450, paddingInline: 35, }}>


        {/* drop down */}
        <div style={{ display: "flex", flexDirection: "row", }}>


          <Select
            labelId="demo-simple-select-label"
            id="demo-simple-select"
            value={"100"}
            label="ssssssssssssssssss"
          // onChange={handleChange}
          >

          </Select>






















        </div>

        {/*link*/}

        <div style={{ alignItems: "center", display: "flex", color: "white", fontFamily: "Poppins" }}>


          <ArrowBackOutlinedIcon style={{ marginInline: 10 }} />
          Custom link




        </div>

        <div style={{ alignItems: "center", fontFamily: "Poppins", color: "white", marginTop: 15 }}>https://testnet.xyz.xyz/trade?ref=
        </div>
        <input type={"text"} placeholder="ENTER" style={{ backgroundColor: "#242731" }} />








      </div>




    </div>
  );
}

const styles = {
  button: {
    backgroundColor: "#353945",
    color: "white",
    fontFamily: "Poppins",
    padding: 4,
    width: 80,
    textAlign: "center",
    borderRadius: 10,
    marginTop: 10,
    marginInline: 5
  }
};

export default Content;
